const polygonSvgBase64 = '';

export const PolygonIcon = () => {
    // Decode the base64 string and replace the class attribute
    const svgString = atob(polygonSvgBase64.replace('data:image/svg+xml;base64,', ''));
    const modifiedSvgString = svgString.replace('class="', 'class="w-6 h-6 ');

    return <div dangerouslySetInnerHTML={{ __html: modifiedSvgString }} />;
};

