export const getIconByName = (name: string) => {

    const icones: Record<string, () => React.JSX.Element> = {
        Home: HomeIcon,
        Bsc: BscIcon,
        Polygon: PolygonIcon,
        Burger: BurgerIcon,
        Marketplace: MarketplaceIcon,
        Assets: AssetsIcon,
        About: AboutIcon,
        Help: HelpIcon,
        Tba: TbaIcon,

    }

    if (icones[name]) {
        return icones[name]();
    }


    return null;

}